import React from 'react';

const Home = () => {
    return (
        <>
            <section id="header" className="">
                <div className="container-fluid nav_bg">
                    <div className="row">
                        <div className="col-10 mx-auto">
                            <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                                <h1>Don't worry. We are here for <strong>every solution.</strong></h1>
                                <h2 className="my-3">Bushwick meh Blue Bottle pork belly mustache skateboard 3 wolf moon. </h2>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};
export default Home;
